import HeroSection from './components/HeroSection';
import WhyDrop2Fill from './components/WhyDrop2Fill';
import AnimationSection from './components/AnimationSection';

const LandingPage = () => {
  return (
    <div>
      <HeroSection />
      <WhyDrop2Fill />
      <AnimationSection />
    </div>
  );
};

export default LandingPage;
